      translation 0 0 %<= fields.scale.value * 2.125 >%
      children [
        Cylinder {
          height %<= fields.scale.value * 4.25 >%
          radius %<= fields.scale.value * 0.33 >%
        }
      ]
    }
    %< } >%
  }
}
